import {createGlobalStyle} from 'styled-components';


export const GlobalStyle = createGlobalStyle`
body {
    font-family: "Kaushan Script";
    padding: 20px 60px;

    @media screen and (max-width: )
  }

  a {
  text-decoration: none;
  color: black
  }

  * {
    box-sizing: border-box;
  }

  *:focus {
    outline: none;
  }
`
